import styled from "styled-components";

export const Image  = styled.img`
	display: none;
`

export const Canvas = styled.canvas `
	height: 100%;
	width: 100%;
	background-image: url('./canvas.jpeg');

`

export const CanvasContainer = styled.div ` 
	width: 75%;
	background-image: url('./canvas.jpeg');

`
